import './Discussion.css';
import React from "react";
import Grid from '@mui/material/Grid'

const DiscussionPage = () => {
    return (
        <div className="discussion-page">
            <Grid container spacing={2}>
                <Grid item xs={8}>
                    <Item>xs=8</Item>
                </Grid>
                <Grid item xs={4}>
                    <Item>xs=4</Item>
                </Grid>
                <Grid item xs={4}>
                    <Item>xs=4</Item>
                </Grid>
                <Grid item xs={8}>
                    <Item>xs=8</Item>
                </Grid>
            </Grid> 
        </div>
    );
};

export default DiscussionPage;
